--- @params y1 number (float)
--- @params z1 number (float)
--- @params x2 number (float)
--- @params y2 number (float)
--- @params z2 number (float)
--- @params width number (float)
--- @params p10 boolean (BOOL)
--- @params includez boolean (BOOL)
--- @return boolean (BOOL)
