---         bVar0 = true;
---     }
---     else
---     {
---         bVar0 = false;
---     }
---     if (VEHICLE::_0xEC69ADF931AAE0C3(Global_1281959)) // _IS_VEHICLE_ENGINE_ON_FIRE
